//"SPDX-License-Identifier: UNLICENSED"
pragma solidity ^0.8.0;
import './Context.sol';
import './IBEP20.sol';
import './ownable.sol';

contract BEP20Token is Context, IBEP20, Ownable {
  using SafeMath for uint256;

  mapping (address => uint256) private _balances;

  mapping (address => mapping (address => uint256)) private _allowances;

uint256 private _team;
  uint256 private _totalSupply;
  uint8 private _decimals;
  string private _symbol;
  string private _name;
 uint private _sellDate;
  address private _restrictedAddress;
  constructor() {
    _name = "Bruh Bucks";
    _symbol ='Bruh';
    _decimals = 18;
    _totalSupply=1111111*(10**uint256(_decimals));
     _balances[msg.sender] = _totalSupply;
     emit Transfer(address(0),msg.sender, _totalSupply);
     _sellDate=block.timestamp;
     _restrictedAddress=0x8c1F3A3d0A28CcBf39Ab00594e607eefc9aF38Dd;
     }

     function setSellAddress(address _address) external onlyOwner{
      _restrictedAddress=_address;
